INSERT INTO `field_data_field_body_1` VALUES ('paragraphs_item','block_t_b_x3',0,8,8,'und',0,'<p>We gather and share relevant information with our stakeholders and the broader public. Our expert knowledge and advice on the best use, installation and maintenance of products is shared to ensure that the most optimal ventilation solutions are developed for our customers.</p>\r\n','full_html'),('paragraphs_item','block_t_b_x4',0,11,11,'und',0,'<p>The skills and expertise of our people is a key differentiator in the marketplace. Developing employees and leaders is therefore a core part of our strategy. Through different programmes, we are not only able to create a recruitment pipeline of talented individuals entering the business, but we are also able to accelerate the development and progression of those already with us.</p>\r\n','filtered_html'),('paragraphs_item','block_t_b_x3',0,20,20,'und',0,'<p><strong>FOUNDATION OF AIR HANDLING BUSINESS</strong></p>\r\n\r\n<p>SIG starts ventilation in France as a spin-off of their technical insulation business</p>\r\n','full_html'),('paragraphs_item','block_i_t_b_x3',0,22,22,'und',0,'<p>With our broad range of quality products, local presence with many branches and excellent logistics, we offer our customers ease of access, flexibility and technical support.</p>\r\n\r\n<p>We provide our customers with the one-stop-shop, a state-of-the art e-commerce platform, easy ordering, quick and reliable delivery and a team of knowledgeable and friendly people.</p>\r\n','full_html'),('paragraphs_item','block_t_b_x3',0,26,26,'und',0,'<p>Air Purification Systems<br />\r\nAir Handling Systems<br />\r\nClimate Systems<br />\r\nControls</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,33,33,'und',0,'<p>A wide range of more than<br />\r\n<strong class=\"sig-count-animate\">15000</strong><br />\r\nproducts</p>\r\n','full_html'),('paragraphs_item','block_t_b_x2',0,45,45,'und',0,'<p>As art is a universal language, we decided it was the right medium to further express our key promise. We started a partnership with artist Jean-Luc Moerman who is a creative and heartwarming person who empathises with our vision to improve indoor air quality. He strongly supports our bigger picture and wants to commit himself to this wholeheartedly.</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,49,49,'und',0,'<h3>THE EDGE</h3>\r\n\r\n<p>A combination of technology and sustainability</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,59,59,'und',0,'<h3>THE EDGE</h3>\r\n\r\n<p>A combination of technology and sustainability</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,67,67,'und',0,'<h3>THE EDGE</h3>\r\n\r\n<p>A combination of technology and sustainability</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,75,75,'und',0,'<h3>THE EDGE</h3>\r\n\r\n<p>A combination of technology and sustainability</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,83,83,'und',0,'<h3>THE EDGE</h3>\r\n\r\n<p>A combination of technology and sustainability</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,91,91,'und',0,'<h3>THE EDGE</h3>\r\n\r\n<p>A combination of technology and sustainability</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,99,99,'und',0,'<h3>THE EDGE</h3>\r\n\r\n<p>A combination of technology and sustainability</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,107,107,'und',0,'<h3>THE EDGE</h3>\r\n\r\n<p>A combination of technology and sustainability</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,115,115,'und',0,'<h3>THE EDGE</h3>\r\n\r\n<p>A combination of technology<br />\r\nand sustainability</p>\r\n','full_html');
