INSERT INTO `field_data_field_body_2` VALUES ('paragraphs_item','block_t_b_x3',0,8,8,'und',0,'<p>Investment in new technologies and products with our key suppliers to guarantee development of state-of-the-art solutions. We want to invest in fabrication and value added assembly to safeguard our independance and to guarantee the quality and continuity of our products.</p>\r\n','full_html'),('paragraphs_item','block_t_b_x4',0,11,11,'und',0,'<p>We fully subscribe to the Zero Harm health and safety programme of the SIG Group: “the health, safety and wellbeing of employees and others is a primary consideration for management at all levels in the development, growth and day-to-day operations of the business, our products and services.”</p>\r\n','filtered_html'),('paragraphs_item','block_t_b_x3',0,20,20,'und',0,'<p><strong>INTERNATIONALISATION AND EXPANSION</strong></p>\r\n\r\n<p>Platform acquisition in Air Handling</p>\r\n','filtered_html'),('paragraphs_item','block_i_t_b_x3',0,22,22,'und',0,'<p>We provide solutions for energy efficient and healthy indoor air quality with expertise in various market segments, ranging from offices and warehouses to hospitals and schools, which are compliant with the latest regulations.</p>\r\n\r\n<p>In everything we do, we offer ways to improve indoor air quality in all aspects, from design in BIM through to delivery at the building spot. Through our high technically skilled staff, we support the project from the design phase to the completion of a building.</p>\r\n','full_html'),('paragraphs_item','block_t_b_x3',0,26,26,'und',0,'<p>Air Duct Systems<br />\r\nFire Protection Systems<br />\r\nFans</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,33,33,'und',0,'<p>Immediate availability of more than<br />\r\n<strong class=\"sig-count-animate\">4000</strong><br />\r\nproducts</p>\r\n','full_html'),('paragraphs_item','block_t_b_x2',0,45,45,'und',0,'<p>Brussels-based Belgian artist Jean-Luc Moerman is a rising star. From applying his stickers around Brussels and NYC, through his first exposition in 1995 (Brussels), and his ongoing expositions in Japan, South Korea, Germany, France and many more, this versatile artist has tackled every surface imaginable; from existing photographs to buildings, stickers, canvas and brick walls.</p>\r\n\r\n<p>Moerman bases his techniques and style on his excellent draughtsmanship using organic and mostly colourful lines, that flow and merge with their subject, constantly evolving and growing, without ever taking possession. The inspiration for Moerman’s distinctive style derives from art forms such as urban graffiti, Japanese calligraphy, Manga, tattoo-art, the world of sci-fi, fashion and advertising.</p>\r\n\r\n<p>Through his art, he reminds us that ‘everyone is tattooed somewhere’, and that inevitably the tattoos we carry, both internal or external, visible to others or concealed, will multiply or spread beyond our immediate control.</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,49,49,'und',0,'<h3>-0.3</h3>\r\n\r\n<p>kWhe/m2/yr. estimated energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,59,59,'und',0,'<h3>-0.3</h3>\r\n\r\n<p>kWhe/m2/yr. estimated energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,67,67,'und',0,'<h3>-0.3</h3>\r\n\r\n<p>kWhe/m2/yr. estimated energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,75,75,'und',0,'<h3>-0.3</h3>\r\n\r\n<p>kWhe/m2/yr. estimated energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,83,83,'und',0,'<h3>-0.3</h3>\r\n\r\n<p>kWhe/m2/yr. estimated energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,91,91,'und',0,'<h3>-0.3</h3>\r\n\r\n<p>kWhe/m2/yr. estimated energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,99,99,'und',0,'<h3>-0.3</h3>\r\n\r\n<p>kWhe/m2/yr. estimated energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,107,107,'und',0,'<h3>-0.3</h3>\r\n\r\n<p>kWhe/m2/yr. estimated energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,115,115,'und',0,'<h3>-0.<span class=\"sig-count-animate\">3</span></h3>\r\n\r\n<p>kWhe/m2/yr. <br />estimated energy consumption</p>\r\n','code');
