INSERT INTO `field_revision_field_body` VALUES ('paragraphs_item','slogan_block',0,3,3,'und',0,'<p>We share and utilise our expertise in improving indoor climates and energy efficiency, in order to create a healthy and safe indoor environment for everyone. Through a strong customer focus, ease of access and reliability we are your solutions oriented partner.</p>\r\n','full_html'),('paragraphs_item','slogan_block',0,4,4,'und',0,'<p>We want to help people to achieve a healthy, safe and energy efficient living and working environment.</p>\r\n','full_html'),('paragraphs_item','slogan_block',0,137,137,'und',0,'<p>We share and utilise our expertise in improving indoor climates and energy efficiency, in order to create a healthy and safe indoor environment for everyone. Through a strong customer focus, ease of access and reliability we are your solutions oriented partner.&nbsp;PL</p>\r\n','full_html'),('paragraphs_item','slogan_block',0,138,138,'und',0,'<p>We want to help people to achieve a healthy, safe and energy efficient living and working environment.&nbsp;PL</p>\r\n','full_html'),('paragraphs_item','slogan_block',0,142,142,'und',0,'<p>We share and utilise our expertise in improving indoor climates and energy efficiency, in order to create a healthy and safe indoor environment for everyone. Through a strong customer focus, ease of access and reliability we are your solutions oriented partner.&nbsp;FR</p>\r\n','full_html'),('paragraphs_item','slogan_block',0,143,143,'und',0,'<p>We want to help people to achieve a healthy, safe and energy efficient living and working environment.&nbsp;FR</p>\r\n','full_html');
