INSERT INTO `field_revision_field_body_3` VALUES ('paragraphs_item','block_t_b_x3',0,8,8,'und',0,'<p>Our vision includes support of organisations that fight to prevent the detrimental effects of bad IAQ in specific healthcare domains. We also help organisations which promote a healthy lifestyle and that have a link to IAQ.</p>\r\n','filtered_html'),('paragraphs_item','block_t_b_x4',0,11,11,'und',0,'<p>We aim to attract and retain the best talent and are committed to recognising excellent performance and celebrating their success with a fair and consistent approach. We strive for a pleasant working environment with equal opportunities for all employees.</p>\r\n','filtered_html'),('paragraphs_item','block_t_b_x3',0,20,20,'und',0,'<p><strong>SPECIALISATION, VALUE ASSEMBLING AND BRANDING</strong></p>\r\n\r\n<p>Further organic growth and acquisitions in Air Handling</p>\r\n','filtered_html'),('paragraphs_item','block_i_t_b_x3',0,22,22,'und',0,'<p>Air quality in rooms and spaces both at home and at work is important to everyone’s comfort, safety and health.</p>\r\n\r\n<p>We provide and deliver tailor-made services to tune and maintain the quality of the indoor climate at the required level, and reduce lifetime costs.</p>\r\n','full_html'),('paragraphs_item','block_t_b_x3',0,26,26,'und',0,'<p>Air Terminal Devices</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,33,33,'und',0,'<p>Delivery services within<br />\r\n<strong class=\"sig-count-animate\">24</strong><br />\r\nhours</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,49,49,'und',0,'<h3>40.7</h3>\r\n\r\n<p>kWhe/m2/yr. standard energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,59,59,'und',0,'<h3>40.7</h3>\r\n\r\n<p>kWhe/m2/yr. standard energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,67,67,'und',0,'<h3>40.7</h3>\r\n\r\n<p>kWhe/m2/yr. standard energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,75,75,'und',0,'<h3>40.7</h3>\r\n\r\n<p>kWhe/m2/yr. standard energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,83,83,'und',0,'<h3>40.7</h3>\r\n\r\n<p>kWhe/m2/yr. standard energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,91,91,'und',0,'<h3>40.7</h3>\r\n\r\n<p>kWhe/m2/yr. standard energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,99,99,'und',0,'<h3>40.7</h3>\r\n\r\n<p>kWhe/m2/yr. standard energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,107,107,'und',0,'<h3>40.7</h3>\r\n\r\n<p>kWhe/m2/yr. standard energy consumption</p>\r\n','full_html'),('paragraphs_item','block_b_x3',0,115,115,'und',0,'<h3><span class=\"sig-count-animate\">40</span>.<span class=\"sig-count-animate\">7</span></h3>\r\n\r\n<p>kWhe/m2/yr. <br />standard energy consumption</p>\r\n','code');
