set autocommit=0;
INSERT INTO `field_revision_field_intro_text` VALUES ('paragraphs_item','intro_text',0,7,7,'und',0,'<p>The fulfillment of our vision is based on three pillars:</p>\r\n','full_html'),('paragraphs_item','intro_text',0,10,10,'und',0,'<p>SIG Air Handling has excellent, highly trained, motivated employees who care passionately about the business. Their wellbeing and engagement is one of our top priorities.</p>\r\n','full_html'),('paragraphs_item','intro_text',0,14,14,'und',0,'<p>SIG PLC’s first significant move into Air Handling came through the acquisition of Air Trade Centre in 2008 (rebranded to SIG Air Handling in 2016) with the rationale that this is a complementary specialist distribution market, with similar environmental drivers as SIG’s insulation and energy management business. The Air Handling business has grown rapidly over recent years and sales increased by 17% in 2015 to €214 million. On a pro forma basis, including full year contributions from infill acquisitions the Group made in H2 2015 and January 2016, sales in this division would be c. €250 million. This is being operated from 100 trading sites in Europe. SIG is targeting sales of at least €400 million by 2018, predominantly through organic growth. In doing so, the Group is aiming to increase its product offering of designing and delivering complete system solutions to customers.</p>\r\n','full_html'),('paragraphs_item','intro_text',0,21,21,'und',0,'<p>SIG Air Handling is a leading supplier of products for heating, ventilation and air conditioning. We offer HVAC project solutions for professional installers and engineering offices through the following propositions:</p>\r\n','full_html'),('paragraphs_item','intro_text',0,24,24,'und',0,'<p>A lot of professional installers rely on SIG Air Handling for a wide range of more than 15,000 products and we know that their time is valuable. Therefore we guarantee an immediate availability of more than 4,000 products and with branches all over the country we aim to always be as close as possible to the customer. Logistic services<br />\r\nlike groupage or on-site delivery reflect our customer centric approach. Furthermore we have a number of night safes in place so customers can pick up orders at their own convenience. And last but not least there’s our e-shop which offers delivery within 24 hours.</p>\r\n\r\n<p>Our customers can always count on the technical expertise of our specialists. They ensure the right product choice is made and keep customers informed about new products and regulations. Online tools like the duct calculator or measurement templates are frequently used and much appreciated by our customers.</p>\r\n','full_html'),('paragraphs_item','intro_text',0,30,30,'und',0,'<p>SIG Air Handling companies comply with all national and European legislation and we test our products and systems regularly in internal and public climate chambers. Different Eurovent certificates, EN fire reports, dust control tests and hygiene labels are available on demand.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Our fire rated products and systems contribute to safer living and working environments, in shopping malls, offices, car parks,schools, hospitals and many other buildings. Via our Category Management Team we select and approve suppliers worldwide to develop more ambitious and rewarding partnerships.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Through our professional expertise we develop added value products and systems for our European businesses.</p>\r\n','full_html'),('paragraphs_item','intro_text',0,36,36,'und',0,'<p>EFA is an umbrella organisation, which at European level represents 39 national patients’ associations in 25 European countries. EFA is dedicated to making Europe a place where people with allergies, asthma and COPD (Chronic Obstructive Pulmonary Disease):</p>\r\n\r\n<ul>\r\n	<li>Have the right to the best quality of care and a safe environment</li>\r\n	<li>Live uncompromised lives</li>\r\n	<li>Are actively involved in all decisions influencing their health</li>\r\n</ul>\r\n','full_html'),('paragraphs_item','intro_text',0,38,38,'und',0,'<p>64 million students and 4.5 million teachers are affected by bad indoor air quality in Europe. Breathing is a prerequisite of life. Depending on regional culture and outdoor climate, Europeans spend most of their time in indoor environments. To breathe, healthy indoor air is therefore considered a fundamental right by the WHO (World Health Organisation).<br />\r\nEFA was an associated partner of the HealthVent project (2010) under the second program of Community Action in the field of health.</p>\r\n','full_html'),('paragraphs_item','intro_text',0,40,40,'und',0,'<p>EFA believes \"As required by the seventh environment action programme, the European Union should adopt a comprehensive strategy on Indoor Air Quality to identify current gaps and propose next steps in order to tackle the negative consequences of poor air indoors. Indoor Air Quality considerations should be included in all policies developed by the European Union, namely in health, environment, energy, climate change, research and single market legislations.\"</p>\r\n','full_html'),('paragraphs_item','intro_text',0,42,42,'und',0,'<p>In relation to ventilation, the EFA recommends that building owners/occupants should receive a detailed guide on how to maintain their ventilation systems so they can control their own IAQ for comfort and cleanliness. EFA aims for clearer regulations which explain who has the responsibility for coping with mould and dampness due to poor ventilation and/or water leakages. IAQ is not, and should not be, the Cinderella of the air pollution field. 2 million healthy lives are lost in the EU every year due to poor indoor air quality. As such, this issue needs to be properly regulated to guarantee that everyone has the fundamental right to breathe healthy indoor air.</p>\r\n','full_html'),('paragraphs_item','intro_text',0,48,48,'und',0,'<p>Donec fermentum sem vitae p