INSERT INTO `search_dataset` VALUES (1,'node',' why we care polski francais improving air because we care indoor air quality has become a major concern for many people in europe and all around the world our mission we share and utilise our expertise in improving indoor climates and energy efficiency in order to create a healthy and safe indoor environment for everyone through a strong customer focus ease of access and reliability we are your solutions oriented partner customer focus expertise ease of access reliable our vision we want to help people to achieve a healthy safe and energy efficient living and working environment air is comfort air is energy air is life download corporate brochure  english english  ',0),(2,'node',' our approach our approach how we fulfill our vision the fulfillment of our vision is based on three pillars information education training we gather and share relevant information with our stakeholders and the broader public our expert knowledge and advice on the best use installation and maintenance of products is shared to ensure that the most optimal ventilation solutions are developed for our customers product development investment in new technologies and products with our key suppliers to guarantee development of stateoftheart solutions we want to invest in fabrication and value added assembly to safeguard our independance and to guarantee the quality and continuity of our products social engagement our vision includes support of organisations that fight to prevent the detrimental effects of bad iaq in specific healthcare domains we also help organisations which promote a healthy lifestyle and that have a link to iaq  ',0),(3,'node',' our people our people our people sig air handling has excellent highly trained motivated employees who care passionately about the business their wellbeing and engagement is one of our top priorities training recruitment the skills and expertise of our people is a key differentiator in the marketplace developing employees and leaders is therefore a core part of our strategy through different programmes we are not only able to create a recruitment pipeline of talented individuals entering the business but we are also able to accelerate the development and progression of those already with us environment health safety we fully subscribe to the zero harm health and safety programme of the sig group the health safety and wellbeing of employees and others is a primary consideration for management at all levels in the development growth and daytoday operations of the business our products and services employee engagement we aim to attract and retain the best talent and are committed to recognising excellent performance and celebrating their success with a fair and consistent approach we strive for a pleasant working environment with equal opportunities for all employees internal communications communicating with our employees is a key priority for us we want to make sure everyone understands our vision and our strategy for realising that vision we are also keen for our people to share their views and opinions so enabling twoway communication is very important  ',0),(4,'node',' facts figures facts figures air handling sig plc s first significant move into air handling came through the acquisition of air trade centre in 2008 rebranded to sig air handling in 2016 with the rationale that this is a complementary specialist distribution market with similar environmental drivers as sig s insulation and energy management business the air handling business has grown rapidly over recent years and sales increased by 17 in 2015 to EU214 million on a pro forma basis including full year contributions from infill acquisitions the group made in h2 2015 and january 2016 sales in this division would be c EU250 million this is being operated from 100 trading sites in europe sig is targeting sales of at least EU400 million by 2018 predominantly through organic growth in doing so the group is aiming to increase its product offering of designing and delivering complete system solutions to customers delivering complete system solutions to customers sig plc company milestones step 1 foundation of air handling business sig starts ventilation in france as a spinoff of their technical insulation business step 2 internationalisation and expansion platform acquisition in air handling step 3 specialisation value assembling and branding further organic growth and acquisitions in air handling  ',0),(5,'node',' customer value propositions customer value propositions sig air handling is a leading supplier of products for heating ventilation and air conditioning we offer hvac project solutions for professional installers and engineering offices through the following propositions distribution with our broad range of quality products local presence with many branches and excellent logistics we offer our customers ease of access flexibility and technical support we provide our customers with the onestopshop a stateofthe art ecommerce platform easy ordering quick and reliable delivery and a team of knowledgeable and friendly people projects we provide solutions for energy efficient and healthy indoor air quality with expertise in various market segments ranging from offices and warehouses to hospitals and schools which are compliant with the latest regulations in everything we do we offer ways to improve indoor air quality in all aspects from design in bim through to delivery at the building spot through our high technically skilled staff we support the project from the design phase to the completion of a building services air quality in rooms and spaces both at home and at work is important to everyone s comfort safety and health we provide and deliver tailormade services to tune and maintain the quality of the indoor climate at the required level and reduce lifetime costs distribution a lot of professional installers rely on sig air handling for a wide range of more than 15000 products and we know that their time is valuable therefore we guarantee an immediate availability of more than 4000 products and with branches all over the country we aim to always be as close as possible to the customer logistic services like groupage or onsite delivery reflect our customer centric approach furthermore we have a number of night safes in place so customers can pick up orders at their own convenience and last but not least there s our eshop which offers delivery within 24 hours our customers can always count on the technical expertise of our specialists they ensure the right product choice is made and keep customers informed about new products and regulations online tools like the duct calculator or measurement templates are frequently used and much appreciated by our customers a wide range of more than 15000 products immediate availability of more than 4000 products delivery services within 24 hours  ',0),(6,'node',' product families product families our solutions st0 fill dff2fd st1 fill b2cf6c st2 fill c2ddb0 st3 fill 635041 st4 fill 7ba14d st5 fill 70b95c st6 fill d9d2bf st7 fill 9ba893 st8 fill ebe6db st9 fill 66e93 st10 fill 004c7c st11 fill 097a97 st12 fill 09678a st13 fill 4573 st14 fill 0a728e st15 fill 70a6ac st16 fill 84a9b3 st17 fill 5a5a5a st18 fill 858686 st19 fill dab14e st20 fill da4f74 st21 fill 506db3 st22 fill 9d9d9c st23 fill ffffff st24 fill 61b44c st25 fill ec6330 st26 fill bd9943 st27 fill 3e7b8a st28 fill 5b96a6 st29 fill c49f45 st30 fill 7b7b4f st31 fill f7a84b st32 fill f19a2f st33 fill 484848 st34 fill 646464 st35 fill ebe7da st36 fill cdd3c1 st37 fill f5f0e4 improvement air purification systems air handling systems climate systems controls movement air duct systems fire protection systems fans diffusion air terminal devices download brochures our products ac ahu fans kitchen hoods filters insulation fire protection fixings ducts dampers diffusion ',0),(7,'node',' safety energy effiency safety energy effiency safety energy efficiency sig air handling companies comply with all national and european legislation and we test our products and systems regularly in internal and public climate chambers different eurovent certificates en fire reports dust control tests and hygiene labels are available on demand our fire rated products and systems contribute to safer living and working environments in shopping malls offices car parks schools hospitals and many other buildings via our category management team we select and approve suppliers worldwide to develop more ambitious and rewarding partnerships through our professional expertise we develop added value products and systems for our european businesses we develop added value products systems  ',0),(8,'node',' efa efa european federation of allergy and airways diseases patients associations efa is an umbrella organisation which at european level represents 39 national patients associations in 25 european countries efa is dedicated to making europe a place where people with allergies asthma and copd chronic obstructive pulmonary disease have the right to the best quality of care and a safe environment live uncompromised lives are actively involved in all decisions influencing their health why is indoor air quality important to us  64 million students and 45 million teachers are affected by bad indoor air quality in europe breathing is a prerequisite of life depending on regional culture and outdoor climate europeans spend most of their time in indoor environments to breathe healthy indoor air is therefore considered a fundamental right by the who world health organisation efa was an associated partner of the healthvent project 2010 under the second program of community action in the field of health why do we support efa  efa believes as required by the seventh environment action programme the european union should adopt a comprehensive strategy on indoor air quality to identify current gaps and propose next steps in order to tackle the negative consequences of poor air indoors indoor air quality considerations should be included in all policies developed by the european union namely in health environment energy climate change research and single market legislations  practical in relation to ventilation the efa recommends that building owners occupants should receive a detailed guide on how to maintain their ventilation systems so they can control their own iaq for comfort and cleanliness efa aims for clearer regulations which explain who has the responsibility for coping with mould and dampness due to poor ventilation and or water leakages iaq is not and should not be the cinderella of the air pollution field 2 million healthy lives are lost in the eu every year due to poor indoor air quality as such this issue needs to be properly regulated to guarantee that everyone has the fundamental right to breathe healthy indoor air website efa ',0),(9,'node',' art art jeanluc moerman why we work with jeanluc moerman as art is a universal language we decided it was the right medium to further express our key promise we started a partnership with artist jeanluc moerman who is a creative and heartwarming person who empathises with our vision to improve indoor air quality he strongly supports our bigger picture and wants to commit himself to this wholeheartedly who is jeanluc moerman brusselsbased belgian artist jeanluc moerman is a rising star from applying his stickers around brussels and nyc through his first exposition in 1995 brussels and his ongoing expositions in japan south korea germany france and many more this versatile artist has tackled every surface imaginable from existing photographs to buildings stickers canvas and brick walls moerman bases his techniques and style on his excellent draughtsmanship using organic and mostly colourful lines that flow and merge with their subject constantly evolving and growing without ever taking possession the inspiration for moerman s distinctive style derives from art forms such as urban graffiti japanese calligraphy manga tattooart the world of scifi fashion and advertising through his art he reminds us that everyone is tattooed somewhere and that inevitably the tattoos we carry both internal or external visible to others or concealed will multiply or spread beyond our immediate control website jl moerman ',0),(10,'node',' sport sport  ',0),(11,'node',' sport sport  ',0),(12,'node',' diffusion language english image  ',0),(13,'node',' dampers language english image  ',0),(14,'node',' ducts language english image  ',0),(15,'node',' fixings language english image  ',0),(16,'node',' fire protection language english image  ',0),(17,'node',' insulation language english image  ',0),(18,'node',' filters language english image  ',0),(19,'node',' kitchen hoods language english image  ',0),(20,'node',' fans language english image  ',0),(21,'node',' ac ahu language english image  ',0),(22,'node',' cases cases filter op segment car parks commercial education health aged care industry offices sports storages captcha this question is for testing whether or not you are a human visitor and to prevent automated spam submissions  ',0),(23,'node',' news news news 5 duis a bibendum tortor aliquam erat volutpat fusce vitae nisl nec lacus venenatis imperdiet quis at ante lorem ipsum dolor sit amet consectetur adipiscing elit nullam at turpis suscipit imperdiet massa eget vestibulum lorem quisque hendrerit massa ante eu pharetra quam vulputate porta ut interdum at magna sed congue ut sed pharetra libero vivamus et purus scelerisque facilisis dui id suscipit purus ut cursus ante turpis vitae tempus est lobortis vitae suspendisse vitae elit et enim porttitor commodo read more july news 4 duis a bibendum tortor aliquam erat volutpat fusce vitae nisl nec lacus venenatis imperdiet quis at ante lorem ipsum dolor sit amet consectetur adipiscing elit nullam at turpis suscipit imperdiet massa eget vestibulum lorem quisque hendrerit massa ante eu pha